package com.servinglynk.hmis.warehouse.core.model;import java.util.Date;import com.fasterxml.jackson.annotation.JsonRootName;@JsonRootName("DeveloperCompany")public class DeveloperCompany extends ClientModel{	private String developerCompanyId;	private String name;	private String domain;	private String logoUrl;	private Account owner;				private Date expectedAppFinishDate;		private String companySkillSet;		private String appExperience;		private int companySize;		private String appPlatforms;		private String contactEmail;		private String status;		public String getStatus() {		return status;	}	public void setStatus(String status) {		this.status = status;	}	public Date getExpectedAppFinishDate() {		return expectedAppFinishDate;	}	public void setExpectedAppFinishDate(Date expectedAppFinishDate) {		this.expectedAppFinishDate = expectedAppFinishDate;	}	public String getCompanySkillSet() {		return companySkillSet;	}	public void setCompanySkillSet(String companySkillSet) {		this.companySkillSet = companySkillSet;	}	public String getAppExperience() {		return appExperience;	}	public void setAppExperience(String appExperience) {		this.appExperience = appExperience;	}	public int getCompanySize() {		return companySize;	}	public void setCompanySize(int companySize) {		this.companySize = companySize;	}	public String getAppPlatforms() {		return appPlatforms;	}	public void setAppPlatforms(String appPlatforms) {		this.appPlatforms = appPlatforms;	}	public String getContactEmail() {		return contactEmail;	}	public void setContactEmail(String contactEmail) {		this.contactEmail = contactEmail;	}	public String getDeveloperCompanyId() {		return developerCompanyId;	}	public void setDeveloperCompanyId(String developerCompanyId) {		this.developerCompanyId = developerCompanyId;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getDomain() {		return domain;	}	public void setDomain(String domain) {		this.domain = domain;	}		public String getLogoUrl() {		return logoUrl;	}	public void setLogoUrl(String logoUrl) {		this.logoUrl = logoUrl;	}		public void setOwner(Account owner)	{		this.owner = owner;	}	public Account getOwner()	{		return this.owner;	}	}